import React from "react";
import { Link, NavLink } from "react-router-dom";

import styles from "./NavBar.module.css";

const NavBar = () => {
  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <NavLink
              to="/page-one"
              className={(navData) => (navData.isActive ? styles.active : "")}
            >
              Page One
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/page-two"
              className={(navData) => (navData.isActive ? styles.active : "")}
            >
              Page Two
            </NavLink>
          </li>

          <li>
            <NavLink
              to="/page-three"
              className={(navData) => (navData.isActive ? styles.active : "")}
            >
              Page Three
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
